deck_description:
resistere con i kaiju e la casa al Pan di Zenzero per poi partire

https://youtu.be/xpBZkXyAKPI

&nbsp;

D/D/D matchups are simple, regardless of the opponent, the goal is to setup going first, then OTK on the third turn. Obviously this doesn't always work out as planned, and when it fails D/D/D transitions into a resource based grind using Savant Kepler and Savant Thomas.

&nbsp;

The primary matchup that is difficult for D/D/D is unfortunately the meta deck of this cup, Eldlich; The fact that Eldlich's hand effect is non-destruction means that it circumvents D/D/D Abyss King Gilgamesh's float, providing the opponent an easy out to the deck's main setup. Additionally, a freshly summoned Eldlich has attack tied with even D/D/D's biggest bunguses, and can just crash into my bosses by battle.

"The major change I would make to my deck is that Go! D/D/D Divine Zero King Rage should have been legal this month and will be going forward, the card is amazing for the deck, fulfilling the same role as D/D Savant Thomas while also being a game-ending option. The only other changes I would make are in my sidedeck, dependent on the results of the upcoming banlist and the predicted metagame resulting."

&nbsp;

Ejeffers got to Top 8 with this deck in the Trinity June YTC.

This format was, at the time, centered around the use, or anti-use, of Golden Lord. Lord is simply the go-to engine, and everything else around it that's high-risk, high-reward simply becomes much harder to stop since the near-infinite looping often draws all the outs that would usually stop such plays. Malice loops become impossible to stop once crow/called are wasted on lord loops. Fusion combos become a nightmare once ash is used to prevent lord summons.

&nbsp;

CallMeShameless came second in the Trinity June YTC with this deck.

Eldlich is the best deck. It’s a format warping archetype, and I feel like every deck without Eldlich was at a disadvantage. Along with that, it includes Ancient Warriors engine and the Buzzsaw Shark engine to summon Rank 4 Xyz monsters like Lavalval Chain and Traptrix Rafflesia. Uni-zombie and the ghost girl hand traps allowed me to synchro summon PSY-Framelord Omega or pop off into Ultimaya Tzolkin plays. Verte Anaconda allowed me to send Fusion Destiny from deck to summon Destiny Hero Dystopia, essentially a 3800 drident with potential 2 draws.

&nbsp;

Anju won the Trinity June YTC with this deck.
